Spatial pattern gets more and more convoluted as you drag your pressed mouse far from the top-left corner of the sketch (and viceversa). At first, around the top-left, you may be tricked into thinking it is predictable, but wait and you'll see.
p.s for proper viewing, it is highlt recommended to download the sketch and increase the two initial parameters as: 
int unitPerSide=256;
int sizeCanvas=512*2;

you can also activate a time evolution factor, by multiplying theta to the sine of the counter

